import React from "react";
import "./App.css";
import { backlogProvider } from "./BacklogContext";

function App() {
  return (
    <BacklogProvider>
      <div className="App">
        <BacklogDisplay />
      </div>
    </BacklogProvider>
  );
}

export default App;
